ns. The guardian dragons were torn from the sky by the gronn living in Blade's Edge, and the leader of the gronn, Gruul, impaled the wyrms he fought on the stone spires of the mountains.\n\nToday Gruul the Dragonkiller is worshipped as a deity by the ogres of Blade's Edge Mountains. His powerful sons ravage both the spires of their home and the plains of Nagrand. Gruul's unparalleled strength and experience in battle would pose a serious threat if he ever chose to attack Horde or Alliance forces in Outland.",lvl=68,mapID=330,u=17},{n(18831,g({u=17},{i(29763,{c=a[54],u=17}),i(29764,{c=a[5],u=17}),i(29762,{c=a[65],u=17}),i(28800,{u=17}),i(28796,{u=17}),i(28801,{u=17}),i(28797,{u=17}),i(28795,{u=17}),i(28799,{u=17})})),n(19044,g({u=17},{ach(692,{u=17}),i(29766,{c=a[54],u=17}),i(29767,{c=a[5],u=17}),i(29765,{c=a[65],u=17}),i(28794,{u=17}),i(28802,{u=17}),i(28825,{u=17}),i(28826,{rwp=50004,u=17}),i(28804,{u=17}),i(28803,{u=17}),i(28822,{u=17}),i(28824,{u=17}),i(28827,{u=17}),i(28828,{u=17}),i(28810,{u=17}),i(28830,{u=17}),i(28823,{u=17}),i(31750,{u=17})}))})),inst(747,g({coords={{47.51,52.08,1944}},isLockoutShared=1,isRaid=1,lore="After the Legion came to Outland, Magtheridon controlled all but small pockets of Outland. Even so, he was taken largely by surprise when Illidan and his allies conquered the Black Temple. Many believed that Magtheridon had been slain in the attack, but, when Illidan discovered that Magtheridon's blood had a transformative, corrupting effect on orcs, the beaten pit lord was dragged to Hellfire Citadel.\n\nBound by chains both physical and magical, Magtheridon survives, at the brink of death. Each day, Illidan's minions drain his tainted blood, pooling it for a purpose as malevolent as Magtheridon himself: the creation of a new army of barbaric fel orcs.",lvl=68,mapID=331,u=17},{n(-17,g({u=17},{q(11002,g({providers={{"i",32385}},r=2,u=17},{i(28792,{u=17}),i(28793,{u=17}),i(28790,{u=17}),i(28791,{u=17})})),q(11003,g({providers={{"i",32386}},r=1,u