tinsert(l,n(-542,g({description="The Opening of the Dark Portal was a one-time event that happened between Prepatch and the launch of TBC and subsequentially removed after. The tabard is the only tabard in the game with the Flex emote built into it and is highly covetted by collectors. Highlord Kruul would spawn randomly outside of the major cities and max level zones of the time.",lvl=55,maps={1419},u=2},{q(10259,g({coords={{58.25,55.05,1419}},qgs={19942},u=2},{ach(2079,{providers={{"i",28788}},u=2}),i(28788,{u=2})}))})));
tinsert(l,n(-539,g({description="In addition to all players on a realm working towards completing the War Effort, one player had to create the Scepter of the Shifting Sands - a very difficult task that could only be solved by a server's top guild back when the questline was added. After the war effort was finished and the army of the Alliance and the Horde arrived in Silithus, the Scepter of the Shifting Sands could be used on the Scarab Gong. Doing so resulted in the opening of Ahn'Qiraj. The first player to bang the Scarab Gong on each server would be rewarded with the Scarab Lord title (in Burning Crusade, the title will not be available in Classic!) and the Black Qiraji Resonating Crystal mount. Anyone else who followed them within 10 hours was rewarded with the title as well.\n\nAlthough it is still possible to complete the questline for the Scepter of the Shifting Sands after the gates have been opened on your server, doing so will not reward neither the Black Qiraji Resonating Crystal nor the Scarab Lord title.",lvl=60,maps={75,1446},rwp=40003,u=15},{n(-17,g({rwp=40003,u=15},{q(8519,{coords={{28.7,89.1,1451}},minReputation=a[138],providers={{"o",180633}},rwp=40003,sourceQuests={8305},u=15}),q(8303,{coords={{49.5,36.4,1451}},cost={{"i",20415,1}},minReputation=a[138],qgs={15180},rwp=40003,sourceQuests={8301},u=15}),q(8575,{coords={{57,85.6,1447}},providers={{"i",20949}},qgs={15481},rwp=40003,sourceQuests={8555},u=15}),q(8743,g({coords={{25.7,90.9,1451}},cost={{"i",21175,1}},providers={{"o",180717}},rwp=40003,sourceQuests={8742},u=1502},{ach(416,{rwp=40003,sourceQuests={8743},u=1502}),title(33,{rwp=40003,u=1502}),mnt(26656,g({b=1,itemID=21176,lvl=60,rwp=40003,u=1502},{}))})),q(8606,g({coords={{65.2,18.6,1446}},maps=a[20],qgs={11811},rwp=40003,sourceQuests={8598},u=15},{qo(1,{coords={{65,72,1452}},cost={{"i",21041,1},{"i",21039,1},{"i",21040,1}},providers={{"n",15554}},rwp=40003,u=15}),i(21042,g({b=1,rwp=40003,u=15},{i(21037,{b=1,rwp=40003,u=15}),i(21041,{b=1,rwp