tinsert(l,n(-540,g({description="The Scourge Invasion was a world event in Patch 1.11 and again during the Wrath of the Lich King Pre-Patch during 3.0.1 that heralded the opening of Naxxramas, the citadel of the dreaded Kel'Thuzad.\n\nSeveral regions of Azeroth came under attack by Scourge forces. Members of the Argent Dawn organized a worldwide counter to the Scourge invasion, keeping an eye out for any necropolis sightings and passing on their information to all adventurers willing to aid them in their struggle.\n\nWith each victory against the Scourge, the defense grows stronger. As more and more invasion attempts are beaten back by the defenders, the Argent Dawn will be able to bestow increasingly more powerful blessings upon those fighting the invaders. If the mortal races focus on clearing the Scourge camps all over the world that have sprung up beneath each necropolis, perhaps the invasion can effectively be halted or even repelled. Those who wish to take up arms against the undead invaders should speak with a representative of the Argent Dawn to learn what regions need help and how the defense is holding up.",maps={1419,1423,1428,1446,1447,1452,1955},OnUpdate=function(t)	if ATTClassicSettings.Unobtainables[31] then	t.u = 2;	t.rwp = nil;	else	t.u = 1601;	t.rwp = 30001;	end	end,rwp=40001,u=1601},{n(-4,g({OnUpdate=function(t)	if ATTClassicSettings.Unobtainables[31] then	t.u = 2;	t.rwp = nil;	else	t.u = 1601;	t.rwp = 30001;	end	end,rwp=40001,u=1601},{ach(2116,{OnUpdate=function(t)	if ATTClassicSettings.Unobtainables[31] then	t.u = 2;	t.rwp = nil;	else	t.u = 1601;	t.rwp = 30001;	end	end,providers={{"i",22999}},rwp=40001,u=1601})})),n(-17,g({OnUpdate=function(t)	if ATTClassicSettings.Unobtainables[31] then	t.u = 2;	t.rwp = nil;	else	t.u = 1601;	t.rwp = 30001;	end	end,rwp=40001,u=1601},{q(12753,{lvl=65,OnUpdate=function(t)	if ATTClassicSettings.Unobtainables[31] then	t.u = 2;	t.rwp = nil;	else	t.u = 1601;	t.rwp = 30001;	end	end,races={3,4},rwp=40001,u=1601}),q(1277