tinsert(l,n(-541,g({description="The Silithyst Must Flow is the name of the world PvP event in Silithus, where players of both factions must try and secure as much Silithyst as possible. Silithyst is a red crystalline dust that reaches the surface through geysers exclusive to the Silithus desert. Both the Alliance and the Horde have taken an interest in this new substance, and researchers on both sides have discovered unique and valuable properties in the dust. The Horde and Alliance camps in the region have both been outfitted with turn-in stations where players can unload the Silithyst they collect. ",lvl=60,maps={1451},u=1602},{q(9416,{coords={{49,36.7,1451}},isBreadcrumb=1,nextQuests={9422},qgs={17081},r=1,u=1602}),q(9415,{coords={{50.7,34.7,1451}},isBreadcrumb=1,nextQuests={9419},qgs={17082},r=2,u=1602}),q(9419,g({coords={{33.3,51.1,1451}},qgs={17080},r=2,rwp=70200,sourceQuests={9415},u=1602},{i(13446,{f=55,lvl=45,spellID=17534}),i(13444,{f=55,lvl=49,spellID=17531})})),q(9422,g({coords={{50.8,69.5,1451}},qgs={17079},r=1,rwp=70200,sourceQuests={9416},u=1602},{i(13446,{f=55,lvl=45,spellID=17534}),i(13444,{f=55,lvl=49,spellID=17531})}))})));
