tinsert(l,m(1414,{m(1457,g({isRaid=1,lore="The atmosphere inside the city is quiet and tranquil. It does not have the feeling of confinement that one would feel in Stormwind or Ironforge, where the buildings are grouped close together. Darnassus is open to the sky, and the graceful bridges spanning the lake around which it is built set the buildings wide apart. The elegant bridges, beautiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history."},{n(-8,{faction(69,{icon="Interface\\Addons\\ATT-Classic\\assets\\Achievement_Character_Nightelf_Female",OnTooltip=function(t)	local reputation = t.reputation;	if reputation < 42000 then	local isHuman = _.RaceIndex == 1;	local repPerTurnIn = isHuman and 82.5 or 75;	local x, n = math.ceil((42000 - reputation) / repPerTurnIn), math.ceil(42000 / repPerTurnIn);	GameTooltip:AddDoubleLine("Runecloth Turn Ins", (n - x) .. " / " .. n .. " (" .. x .. ")", 1, 1, 1);	end	end,r=2})}),n(-17,{q(7799,{coords={{64,23,1457}},cost={{"i",4338,60}},lvl=40,qgs={14725},r=2,rwp=40003}),q(7800,{coords={{64,23,1457}},cost={{"i",14047,60}},lvl=50,qgs={14725},r=2,rwp=40003}),q(10354,{coords={{64,23,1457}},cost={{"i",4306,60}},lvl=26,qgs={14725},r=2,rwp=40003}),q(10352,{coords={{64,23,1457}},cost={{"i",2592,60}},lvl=12,qgs={14725},r=2,rwp=40003}),q(7801,{coor